const Header = () => {
  return (
    <div className="header">
      <nav className="navbar navbar-expand-lg navbar-dark bg-transparent">
        <a className="navbar-brand" href="#">
          <img src="/img/logo-white.svg" width="76" alt="" />
        </a>
        <button
          className="navbar-toggler border-0"
          type="button"
          data-toggle="collapse"
          data-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <img src="/img/sandwich.svg" />
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav middle m-auto">
            <li className="nav-item">
              <a className="nav-link" href="#">
                Why us?
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">
                Products
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">
                Customers
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">
                Resources
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">
                Support
              </a>
            </li>
          </ul>
          <ul className="navbar-nav">
            <li className="nav-item">
              <a className="nav-link" href="#">
                <svg
                  width="22"
                  height="20"
                  viewBox="0 0 22 20"
                  fill="none"
                  xmlns="http://www.w3.org/2000/svg"
                >
                  <path
                    d="M1 16.3286V7.68164H6.50261V16.3286C6.50261 17.8481 5.27081 19.0799 3.7513 19.0799C2.2318 19.0799 1 17.8481 1 16.3286Z"
                    stroke="white"
                    strokeWidth="1.5"
                  />
                  <path
                    d="M4.14441 19.08H16.8459C18.9481 19.08 20.6522 17.3759 20.6522 15.2737V1H6.50267V8.99692"
                    stroke="white"
                    strokeWidth="1.5"
                  />
                  <path
                    d="M9.25378 4.93042H18.2938"
                    stroke="white"
                    strokeWidth="1.5"
                  />
                  <path
                    d="M9.25378 8.07471H18.2938"
                    stroke="white"
                    strokeWidth="1.5"
                  />
                  <path
                    d="M9.25378 11.2192H18.2938"
                    stroke="white"
                    strokeWidth="1.5"
                  />
                </svg>
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">
                <svg
                  width="23"
                  height="22"
                  viewBox="0 0 23 22"
                  fill="none"
                  xmlns="http://www.w3.org/2000/svg"
                >
                  <ellipse
                    cx="11.8261"
                    cy="7.73073"
                    rx="2.88462"
                    ry="3.07692"
                    stroke="white"
                    strokeWidth="1.75"
                  />
                  <path
                    d="M20.0985 17.0203C18.0012 14.8575 15.0343 13.5085 11.745 13.5085C8.45571 13.5085 5.48875 14.8575 3.39148 17.0203"
                    stroke="white"
                    strokeWidth="1.75"
                  />
                  <circle
                    cx="11.826"
                    cy="11"
                    r="10"
                    stroke="white"
                    strokeWidth="1.75"
                  />
                </svg>
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">
                <svg
                  width="20"
                  height="19"
                  viewBox="0 0 20 19"
                  fill="none"
                  xmlns="http://www.w3.org/2000/svg"
                >
                  <circle
                    cx="11.3713"
                    cy="7.95455"
                    r="6.95455"
                    stroke="white"
                    strokeWidth="1.75"
                  />
                  <path
                    d="M1.32593 17.9999L6.73502 12.5908"
                    stroke="white"
                    strokeWidth="1.75"
                  />
                </svg>
              </a>
            </li>
            <li className="nav-item pl-3">
              <a className="nav-link free-trial" href="#">
                <button>Free trial</button>
              </a>
            </li>
          </ul>
        </div>
      </nav>
      <style jsx>{`
        .header {
          nav {
            padding: 37px 50px;
            background: white;
            @media (max-width: 1030px) {
              padding: 30px;
            }
            ul {
              &.middle li {
                padding: 0 22px;
                @media (max-width: 1140px) {
                  padding: 0 15px;
                }
                @media (max-width: 1070px) {
                  padding: 0 10px;
                }
              }
              &:first-of-type {
                li a {
                  position: relative;
                  &:after {
                    content: "";
                    position: absolute;
                    left: 0;
                    bottom: 0;
                    width: 100%;
                    height: 2px;
                    background: transparent;
                    -webkittransition: all 0.5s;
                    -moztransition: all 0.5s;
                    -mstransition: all 0.5s;
                    -otransition: all 0.5s;
                    transition: all 0.5s;
                    -webkittransform: translateY(20px);
                    -moztransform: translateY(20px);
                    -mstransform: translateY(20px);
                    -otransform: translateY(20px);
                    transform: translateY(20px);
                  }
                  &:hover:after {
                    background: #ffdb00;
                    -webkittransform: translateY(0);
                    -moztransform: translateY(0);
                    -mstransform: translateY(0);
                    -otransform: translateY(0);
                    transform: translateY(0);
                  }
                }
              }
              li {
                margin-top: auto;
                margin-bottom: auto;
                position: relative;
                text-align: center;
                a {
                  font-family: "Apercu Medium";
                  font-size: 18px;
                  color: white !important;
                  svg * {
                    -webkit-transition: all 0.5s;
                    -moz-transition: all 0.5s;
                    -ms-transition: all 0.5s;
                    -o-transition: all 0.5s;
                    transition: all 0.5s;
                  }
                  &:hover svg * {
                    stroke: #ffdb00;
                  }
                }
                button {
                  font-size: 16px;
                  color: #221f20;
                  padding: 12px 18px;
                  background: #ffdb00;
                  border: none;
                  -webkit-border-radius: 0;
                  -moz-border-radius: 0;
                  border-radius: 0;
                  -webkit-transition: background 0.5s;
                  -moz-transition: background 0.5s;
                  -ms-transition: background 0.5s;
                  -o-transition: background 0.5s;
                  transition: background 0.5s;
                  &:hover {
                    background: white;
                  }
                }
              }
            }
          }
        }
      `}</style>
    </div>
  );
};

export default Header;
